# =========================================================
# ⚡ SPEED (MAX)
# =========================================================
DELAY_BETWEEN_ROUNDS = 0.0
PER_SEND_PAUSE = 0.0

PAGE_TIMEOUT = 60000
BOX_TIMEOUT = 60000

# =========================================================
# 🌙 CLEAN LOGGING
# =========================================================
logging.basicConfig(level=logging.INFO, format="🎧 %(asctime)s | %(message)s")

# =========================================================
# HELPERS
# =========================================================
async def get_textbox(page):
    try:
        box = page.locator('div[role="textbox"]')
        await box.wait_for(timeout=BOX_TIMEOUT)
        return box
    except PWTimeout:
        await page.reload(wait_until="domcontentloaded", timeout=PAGE_TIMEOUT)
        box = page.locator('div[role="textbox"]')
        await box.wait_for(timeout=BOX_TIMEOUT)
        return box

async def send_message(page, text):
    box = await get_textbox(page)
    await box.click()
    await box.fill(text)
    await page.keyboard.press("Enter")
    if PER_SEND_PAUSE:
        await asyncio.sleep(PER_SEND_PAUSE)

# =========================================================
# MAIN
# =========================================================
async def main():
    async with async_playwright() as p:
        browser = await p.chromium.launch(
            headless=True,
            args=["--no-sandbox", "--disable-gpu"]
        )

        context = await browser.new_context()
        await context.add_cookies([{
            "name": "sessionid",
            "value": SESSION_ID,
            "domain": ".instagram.com",
            "path": "/",
            "httpOnly": True,
            "secure": True,
            "sameSite": "None"
        }])

        pages = []
        for i, url in enumerate(GC_URLS):
            page = await context.new_page()
            await page.goto(url, wait_until="domcontentloaded", timeout=PAGE_TIMEOUT)
            await get_textbox(page)
            pages.append(page)
            logging.info(f"🌙 gc ready [{i}]")

        logging.info("🌊 lofi ultra-fast mode started")

        while True:
            tasks = []
            for idx, page in enumerate(pages):
                pool = GC_TEXT_MAP.get(idx, [])
                if pool:
                    tasks.append(send_message(page, random.choice(pool)))

            if tasks:
                await asyncio.gather(*tasks)

            if DELAY_BETWEEN_ROUNDS:
                await asyncio.sleep(DELAY_BETWEEN_ROUNDS)

        await browser.close()

# =========================================================
# ENTRY
# =========================================================
if __name__ == "__main__":
    asyncio.run(main())
